DROP TABLE IF EXISTS `t_resource`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `t_resource` (
  `RESOURCE_ID` bigint(20) NOT NULL COMMENT '菜单/按钮ID',
  `PARENT_ID` bigint(20) NOT NULL COMMENT '上级菜单ID',
  `RESOURCE_NAME` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '菜单/按钮名称',
  `COMPONENT` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `PATH` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '菜单URL',
  `REAL_PATH` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `REDIRECT` varchar(100) DEFAULT NULL,
  `PERMS` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '权限标识',
  `ICON` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '图标',
  `TYPE` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '类型 0菜单 1按钮',
  `EXTERNAL_LINK` tinyint(1) DEFAULT NULL,
  `SHOW_IN_MENU` tinyint(1) DEFAULT NULL,
  `KEEP_ALIVE` tinyint(1) DEFAULT NULL,
  `STATUS` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `CURRENT_ACTIVE_MENU` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
